{'longTextContent': '滋食.小饼干 拍5件约100小包 只要【￥16.8】！

   饼干非常酥，馅也很多，口感是酥软的那种，有5款可以选，不知道选啥就听姐的[ok]！咸蛋黄味和黑糖麦芽味放心入，姐的最爱，超好吃[馋嘴]！！

   咸蛋黄味的夹心稍微软一点，但是不会粘牙[锦鲤]，咸咸香香，里面的馅软软的，这个最喜欢吃了！！！黑糖味的夹心要稍微硬一些，嚼起来有点像小时候吃的卷糖~', 'url_objects': []}

